import './styles.css';
import Weather from './Weather';
import CityTimeConditions from "./CityTimeConditions";

export default function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="wrapper border weather-app col">
          <div className="col-search">
            <Weather />
          </div>
          <CityTimeConditions />
        </div>
    </div>
    </div>
  );
}
